import React from 'react'
import styled from 'styled-components'
// import CoverVideoScript from '../CoverVideoScript/CoverVideoScript'
// import LottieScript from '../lottieScript/LottieScript'
// import lottie from '../lottieScripts/lottieScript'
// import lottie from '../lottieScripts/lottie'

const VideoContainer = styled.div`
width: 100%;
background-color:#fff;
width:100%;
height:100%;
display:block;
overflow: hidden;
transform: translate3d(1000,0,0);
text-align: center;
opacity: 1;
`
const CoverVideo = () => {
  return (
    <>
    <VideoContainer>
        <div id="lottie"></div>
    </VideoContainer>
    <script src="../lottieScripts/lottie"></script>
    <script src="../lottieScripts/lottieScript"></script>
    </>
  )
}

export default CoverVideo
